import React, {Component} from "react";
import Project from './Projects';
import SocialProfiles from './SocialProfiles';
import profile from './assets/profile.png'

class App extends Component {
  state = {displayBio: false};
  // constructor(){
  //   super(); // reference to the root component class
  //   // state is an updatable structure which contains data of the component class.
  //   this.state = {displayBio : false}; 
  //   this.toggleBio = this.toggleBio.bind(this);
  // }
  toggleBio = () => {
    this.setState({displayBio: ! this.state.displayBio});
  }
  render(){
    return (
      <div>
        <img src = {profile} alt = 'profile' className = "profile" />
        <h1>Fakhra Najm</h1>
        <p>Department of Electrical Engineering</p>
        <p>Faculty of Engineering and Technology</p>
        <p>Jamia Millia Islamia</p>
        {
          this.state.displayBio ?( 
          <div>
            <p style = {{fontWeight:"bold",  color: "#50360B"}}>Languages Known:</p>
              <div style = {{color: "#0B2550"}}>
                <p>C</p>
                <p>C++</p>
                <p>Javascript</p>
                <p>Mysql</p>
                <p>PHP</p>
              </div>
            <p style = {{fontWeight:"bold", color: "#50360B"}}>Learning:</p>
            <div style = {{color: "#0B2550"}}>
              <p>Data-structure</p>
              <p>Frontend development</p>
              <p>React</p>
              <p>Bootstrap</p>
            </div>

            <button onClick={this.toggleBio} class = "btn-warning">read Less</button>
          </div> ):
          (
          <div>
            <button onClick={this.toggleBio} class = "btn-primary">read More</button>
          </div>
          )
        }
        <hr/>
        <Project/>
        <hr/>
        <SocialProfiles/>
      </div>
    )
  }  
}

export default App;
